export default () => (
  <header>
    <nav>
      <h1>Killerpedia</h1>
      <em>Browse by:</em>
      <style jsx>{`
        nav {
          max-width: 1400px;
          margin: 0 auto;
          display: flex;
        }

        h1 {
          font-size: 2rem;
          margin: 4px 0;
        }
      `}</style>
    </nav>
  </header>
);
